import React from 'react'

const AboutAuth = () => {
  return (
    <div className='auth-'>
        Join the Stack Overflow community Get unstuck ask a question Unlock new privileges like voting and commenting Save your favorite tags, filters, and jobs Earn reputation and badges Collaborate and share knowledge with a private group for Get Stack Overflow for Teams free for up to 50 users.
    </div>
  )
}

export default AboutAuth
